      arr.push(bracket)
    } else if (closers.includes(bracket)) {
      let last = arr.pop()
      if (!(bracket === '}' &amp;&amp; last === '{') &amp;&amp; !(bracket === ')' &amp;&amp; last === '(') &amp;&amp; !(bracket === ']' &amp;&amp; last === '[')) {
